graphql.query:
{
  TestimonialList(
    filter: { 
      first_name: { eq: "test" }
    }
    pageSize: 6
    currentPage: 1
  ) {
    testimonialList {
     testimonial_id
      first_name
      last_name
      email
      image_name
      image_url
      company
      website
      designation
      rating
      title
      content
    }
    total_count
    total_pages
  }
}

mutation {
  UpdateTestimonial(
    id: 7
    input: {
      email: "neel.peater@mageinic.com"
      first_name: "Neel"
      last_name: "Peater"
    }
  ) {
    testimonial_id
    title
    content
    designation
    first_name
    last_name
    email
    image_name
    image_url
    rating
    company
    website
  }
}
